import React from 'react';
import logo from './logo.svg';
import './App.css';

function getRandom(min, max) {
    min = Math.ceil(min);
    max = Math.floor(max);
    return Math.floor(Math.random() * (max - min + 1)) + min;
}


function Input(){
  return (
     <input />
  )
}

function Text(){
  return (
    <input type="text" value="5"/>
  )
}

function Text2(){
  return (
    <input type="text" value="6"/>
  )
}

function App() {
  return (
  <div className="App">
    <header className="App-header">
    <p>
     Vardhan G, lets do Maths...
     </p>
<form>
    <div class="box">
       {getRandom(1,9)}  +  {getRandom(1,9)} = <Input />
    </div>
</form>
     </header>
  </div>
   )
}

export default App;

